import React from 'react'
import Filho from './Filho'

export default props => {
    const notificarSaidaDoFilho = lugar => alert(`Liberador para ${lugar}`)
    return (<div>
        <Filho notificar={notificarSaidaDoFilho}></Filho>
    </div>)
}
